$white:#fff;
$blue: #4078c0;
$gray:#3c4146;
$lightGray:#767676;

* {
    box-sizing: border-box;
}

.body__container {
    font-weight: 400;
    color: #333;
    font-family: 'Roboto Slab', serif;
}

a {
    text-decoration: none;
}

.section {
    position: relative;

    .inner {
        max-width: 980px;
        margin: 0 auto;
        position: relative;
    }
}

.summary {
    .summary__title {
        font-size: 38px;
        font-weight: 300;
        line-height: 1.25;
        margin-bottom: 18px;
    }

    .summary__description {
        font-size: 26px;
        font-weight: 300;
        color: gray;
        line-height: 1.5;
    }
}



@mixin btn {
    font-size: 14px;
    font-weight: 500;
    height: 34px;
    background: #eee linear-gradient(to bottom, #fcfcfc, #eee);
    border: 1px solid #d5d5d5;
    border-radius: 4px;
    display: inline-flex;
    align-items: center;
    padding: 0 12px;
    cursor: pointer;
    box-sizing: border-box;
    position: relative;
    color: #333;

    &:hover::before {
        content: '';
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        background: rgba(0, 0, 0, 0.07);
    }
}

@mixin btn--primary {
    @include btn;
    border: 1px solid #65b836;
    color: #fff;
    background: #55a532 linear-gradient(#94dd70, #55ae2e);
}

@mixin input--text {
    height: 34px;
    padding: 0 10px;
    box-sizing: border-box;
    border: 1px solid #ddd;
    border-radius: 5px;
    outline: none;
    box-shadow: inset 0 1px 2px rgba(0, 0, 0, 0.15);
    font-size: 16px;

    &:focus {
        border-color: #51a7e8;
        box-shadow: inset 0 1px 2px rgba(0, 0, 0, 0.15),
            0 0 5px rgba(81, 167, 232, 0.5);
    }

    &::-webkit-input-placeholder {
        color: #cacaca
    }

    &::-ms-input-placeholder {
        color: #cacaca
    }

    &::-moz-input-placeholder {
        color: #cacaca
    }

}

.btn {
    @include btn;
}

.btn--primary {
    @include btn--primary;
}

.input--text {
    @include input--text;
}

