                    padding: 10px;
                    color: $gray;

                    &:hover {
                        color: $blue;
                    }
                }
            }

        }

        .sign-group {
            display: flex;
            flex-direction: row-reverse;
            align-items: center;
            height: 100%;

            .btn-group {
                display: flex;

                .btn {
                    margin-right: 4px;
                }

                .btn--primary {}
            }

            #search-form {
                .input--text {
                    width: 160px;
                    font-size: 14px;
                    margin-right: 12px;
                }
            }

            .sub-menu {
                display: flex;
                margin-right: 10px;

                a {
                    display: block;
                    padding: 8px;
                    font-size: 13px;
                    color: $gray;

                    &:hover {
                        color: $blue;
                    }
                }
            }
        }
    }
}

